syntax = "proto2";

package video_streaming;

import "youtube/api/innertube/compression_type.proto";

option java_package = "com.google.android.apps.youtube.proto.streaming";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTVS";

message CryptoParams {
	optional bytes hmac = 4;
	optional bytes iv = 5;
	optional youtube.api.innertube.CompressionType compression_type = 6;
}
